description:
Release date: 06/01/2009

Rating: 8.2

&quot;Its time to kickoff 09 with another episode of Money Talks. We start the year with a couple girls and a little celebration we like to call Champagne Bukkake. Then we head to the beach for some classic street action, and a cold dip in the ocean. Finally the crew goes for a paintball session where they meet Aza. And after some negotiating, she is more than willing to give it all up for the right price.&quot;
